function solution(seq1,seq2){
    // Seq2를 Seq1에 매치시키고자 합니다. -> seq2의 길이가 seq1보다 작거나 같다
    let answer = []
    let minHD = seq2.length // hamming distance 를 최대값으로 설정
    // 순회하면서 HD값 판별
    for(let start = 0; start < seq1.length - seq2.length + 1; start ++){
        let HD = 0
        for(let matchIdx = start; matchIdx < start + seq2.length; matchIdx++){
            if(seq1[matchIdx] !== seq2[matchIdx - start]){
                HD ++
            }
        }
        if(minHD > HD){
            answer = [start+1]
            minHD = HD
        }else if(minHD === HD){
            answer.push(start+1)
        }
    }
    return answer.join(', ')
}

console.log(solution('','AG'))
